import React from 'react';

const UpdateProfile = () => {
    return (
        <div className="direction-rtl">
            <h2 className="text-lg font-bold text-main1 mb-4 font-tajawal">تحديث الملف الشخصي</h2>
            <p className="text-gray-600 font-tajawal">
                سيتم إضافة نموذج تحديث الملف الشخصي هنا لاحقاً...
            </p>
        </div>
    );
}

export default UpdateProfile;
